local L_NamesByNum = {
   FunctionId = 1,
   ParentId = 2,
   FunctionPosType = 3,
   OpenMenu = 4,
   FunctionSortNum = 5,
   FunctionInCross = 7,
   Guide = 10,
   BackSwitch = 11,
}
local L_NamesByString = {
   MainIcon = 6,
   StartVariables = 8,
   FunctionName = 9,
}
local L_ColNameIndexs = {
   FunctionId = 0,
   ParentId = 1,
   FunctionPosType = 2,
   OpenMenu = 3,
   FunctionSortNum = 4,
   MainIcon = 5,
   FunctionInCross = 6,
